! **********************************************************************
#ifdef PRECISION_dp
subroutine amp2(P_scatt, M2, I, MOM, nextcombs, extcombs, M2munu) &
    & bind(c,name="ol_f_amp2_ppttjj_ttxddxggg_1")
#else
subroutine amp2(P_scatt, M2, I, MOM, nextcombs, extcombs, M2munu)
  use ol_tree_ppttjj_ttxddxggg_1_/**/DREALKIND, only: ntry, nhel, Hel, M1helarr
#endif
! P_scatt(0:3,Npart) = incoming external momenta
! M2  = helicity-summed squared matrix element for top anti-top down anti-down glue glue glue -> 0
! I   = emitter, 0 means none (replace wave function I in the current crossing by the momentum MOM),
!       for I < 0 emitter for PowHeg's B^mu,nu
! MOM = external "polarisation vector" for gluon emitter
! nextcombs is the length of the array extcombs
! The elements of the array extcombs specify for which external particle combinations
!   the colour correlations will be calculated. For particles i,j: i*(i-1)/2+j
!   i=j=0 -> 0 means no colour insertion.
! M2munu = Spin correlated born squared amplitude in PowHeg format B^mu,nu for emitter -I
! **********************************************************************
  use ol_parameters_decl_/**/REALKIND !, only: ci, parameters_status, ZERO, scalefactor, >masses<
  use ol_parameters_init_/**/REALKIND, only: ensure_mp_init
  use ol_kinematics_/**/REALKIND, only: conv_mom_scatt2in, internal_momenta
  use ol_momenta_decl_/**/DREALKIND, only: momenta_nan_check
  use ol_momenta_decl_/**/REALKIND, only: Q
  use ol_data_types_/**/REALKIND
  use ol_helicity_bookkeeping_/**/REALKIND, only: &
    & helbookkeeping_wf, helsync, flip_phase
  use ol_helicity_init, only: helbookkeeping_flip, helsync_flip
  use ol_h_propagators_/**/REALKIND
  use ol_h_wavefunctions_/**/REALKIND
  use ol_h_vertices_/**/REALKIND
  use ol_h_contractions_/**/REALKIND
  use ol_external_ppttjj_ttxddxggg_1, only: external_perm_ppttjj_ttxddxggg_1, &
    & external_perm_inv_ppttjj_ttxddxggg_1, extcomb_perm_ppttjj_ttxddxggg_1, &
    & average_factor_ppttjj_ttxddxggg_1
  use ol_external_ppttjj_ttxddxggg_1, only: H, hel_not_initialised, hel_init
  use ol_colourmatrix_ppttjj_ttxddxggg_1_/**/REALKIND, only: colmat_not_initialised, colourmatrix_init
  use ol_forced_parameters_ppttjj_ttxddxggg_1_/**/REALKIND, only: check_forced_parameters
  use ol_heltables_ppttjj_ttxddxggg_1
  use ol_kinematics_/**/REALKIND, only: LC2Std_Rep_cmplx
  implicit none

  real(DREALKIND), intent(in)  :: P_scatt(0:3,7)
  real(REALKIND),  intent(out) :: M2(0:30-1)
  real(REALKIND),  intent(out) :: M2munu(4,4)
  integer,         intent(in)  :: I
  real(REALKIND),  intent(in)  :: MOM(0:3)
  integer,         intent(in)  :: nextcombs
  integer,         intent(in)  :: extcombs(nextcombs)

  integer           :: ReplacePol, JBmunu, extcombs_permuted(nextcombs), shift, k, r, l, m, n
  real(REALKIND)    :: P(0:3,7)
  real(REALKIND)    :: extmasses2(7)
  real(REALKIND)    :: M2add(0:30-1), M2munuadd
  complex(REALKIND) :: MOM_LC(4), M1(48), M1helarray(48,128)
  type(wfun) :: ep(2)
  complex(REALKIND) :: epStd(1:4,2)
  integer(intkind1) :: hmunu
  real(REALKIND), save :: scalebackfactor, old_scalefactor = 0
  integer(intkind1) :: nsync

  ! type(wfun) :: ex1(h1), ex2(h2), ... ! external wave functions for h<n> helicities
  type(wfun) :: ex1(2), ex2(2), ex3(2), ex4(2), ex5(2), ex6(2), ex7(2)

  ! type(wfun) :: wf<h>(h,n), ... ! n wave functions with h helicity configurations
  type(wfun) :: wf4(4,29), wf8(8,104), wf16(16,187), wf32(32,9), wf128(128,393)

  type(polcont) :: A(128,393)
  complex(REALKIND) :: Aj(393)

  complex(REALKIND) :: omega(2) ! phases for helicity correlations

  call ensure_mp_init()

  if (hel_not_initialised) call hel_init()
  if (colmat_not_initialised) call colourmatrix_init()
  if (factors_status /= parameters_status) then
    ! Note: if factors_init would only be called when parameters changed which are relevant for the factors,
    ! a different 'status' would have to be used, because check_forced_parameters should be called after every parameter change.
    call check_forced_parameters()
    call factors_init()
  end if

  if (momenta_nan_check(P_scatt) /= 0) then
    M2 = 0
    return
  end if

  ! Convert 2 -> n-2 PS-point to n -> 0 (so that P(1) + ... + P(n) = 0)
  extmasses2 = [ rMT2, rMT2, rZERO2, rZERO2, rZERO2, rZERO2, rZERO2 ]
  call conv_mom_scatt2in(P_scatt, extmasses2, P, external_perm_inv_ppttjj_ttxddxggg_1,7)

  ! internal-propagator momenta in light-cone representation
  call internal_momenta(P,7)

  ! denominators
  call born_denominators_init()

  ReplacePol = 0
  JBmunu = 0
  if (I > 0) then
    ReplacePol = external_perm_ppttjj_ttxddxggg_1(I)
  else if (I < 0) then
    JBmunu = external_perm_ppttjj_ttxddxggg_1(-I)
  end if

  do k = 1, nextcombs
    extcombs_permuted(k) = extcomb_perm_ppttjj_ttxddxggg_1(extcombs(k))
  end do

  if (heltables_not_init) call init_heltables()

  ! external WFs
  call wf_Q(P(:,1), rMT, H1, ex1)
  call wf_A(P(:,2), rMT, H2, ex2)
  call wf_Q(P(:,3), rZERO, H3, ex3)
  call wf_A(P(:,4), rZERO, H4, ex4)
  call wf_V(P(:,5), rZERO, H5, ex5)
  call wf_V(P(:,6), rZERO, H6, ex6)
  call wf_V(P(:,7), rZERO, H7, ex7)


  if (ntry == 1) then
    shift = 1
    ! call helbookkeeping_flip(H1, 1, shift, eflip, exthel, firstpol)
    ! call helbookkeeping_wf(H1, ex1, shift) ...
    call helbookkeeping_flip(H1, 1, shift, eflip, exthel, firstpol)
    call helbookkeeping_wf(H1, ex1, shift)
    call helbookkeeping_flip(H2, 2, shift, eflip, exthel, firstpol)
    call helbookkeeping_wf(H2, ex2, shift)
    call helbookkeeping_flip(H3, 3, shift, eflip, exthel, firstpol)
    call helbookkeeping_wf(H3, ex3, shift)
    call helbookkeeping_flip(H4, 4, shift, eflip, exthel, firstpol)
    call helbookkeeping_wf(H4, ex4, shift)
    call helbookkeeping_flip(H5, 5, shift, eflip, exthel, firstpol)
    call helbookkeeping_wf(H5, ex5, shift)
    call helbookkeeping_flip(H6, 6, shift, eflip, exthel, firstpol)
    call helbookkeeping_wf(H6, ex6, shift)
    call helbookkeeping_flip(H7, 7, shift, eflip, exthel, firstpol)
    call helbookkeeping_wf(H7, ex7, shift)

  end if

  ! internal WFs
  ! e.g. call vert_VQ_A(ntry, ex3, ex1, wf1, n1, t1) ...
  call vert_QA_V(ntry, ex1, ex2, wf4(:,1), n3(:,1), t3x4(:,:,1))
  call vert_QA_V(ntry, ex3, ex4, wf4(:,2), n3(:,2), t3x4(:,:,2))
  call vert_UV_W(ntry, ex5, Q(:,16), ex6, Q(:,32), wf4(:,3), n3(:,3), t3x4(:,:,3))
  call vert_GGG_G(ntry, wf4(:,1), wf4(:,2), ex7, wf32(:,1), n4(:,1), t4x32(:,:,1))
  call vert_GGG_G(ntry, wf4(:,2), ex7, wf4(:,1), wf32(:,2), n4(:,2), t4x32(:,:,2))
  call vert_GGG_G(ntry, ex7, wf4(:,1), wf4(:,2), wf32(:,3), n4(:,3), t4x32(:,:,3))
  call vert_UV_W(ntry, ex5, Q(:,16), ex7, Q(:,64), wf4(:,4), n3(:,4), t3x4(:,:,4))
  call vert_GGG_G(ntry, wf4(:,1), wf4(:,2), ex6, wf32(:,4), n4(:,4), t4x32(:,:,4))
  call vert_GGG_G(ntry, wf4(:,2), ex6, wf4(:,1), wf32(:,5), n4(:,5), t4x32(:,:,5))
  call vert_GGG_G(ntry, ex6, wf4(:,1), wf4(:,2), wf32(:,6), n4(:,6), t4x32(:,:,6))
  call vert_UV_W(ntry, wf4(:,1), Q(:,3), ex5, Q(:,16), wf8(:,1), n3(:,5), t3x8(:,:,1))
  call vert_GGG_G(ntry, wf4(:,2), ex6, ex7, wf16(:,1), n4(:,7), t4x16(:,:,1))
  call vert_GGG_G(ntry, ex6, ex7, wf4(:,2), wf16(:,2), n4(:,8), t4x16(:,:,2))
  call vert_GGG_G(ntry, ex7, wf4(:,2), ex6, wf16(:,3), n4(:,9), t4x16(:,:,3))
  call vert_UV_W(ntry, wf4(:,2), Q(:,12), ex5, Q(:,16), wf8(:,2), n3(:,6), t3x8(:,:,2))
  call vert_GGG_G(ntry, wf4(:,1), ex6, ex7, wf16(:,4), n4(:,10), t4x16(:,:,4))
  call vert_GGG_G(ntry, ex6, ex7, wf4(:,1), wf16(:,5), n4(:,11), t4x16(:,:,5))
  call vert_GGG_G(ntry, ex7, wf4(:,1), ex6, wf16(:,6), n4(:,12), t4x16(:,:,6))
  call vert_UV_W(ntry, ex6, Q(:,32), ex7, Q(:,64), wf4(:,5), n3(:,7), t3x4(:,:,5))
  call vert_GGG_G(ntry, wf4(:,1), wf4(:,2), ex5, wf32(:,7), n4(:,13), t4x32(:,:,7))
  call vert_GGG_G(ntry, wf4(:,2), ex5, wf4(:,1), wf32(:,8), n4(:,14), t4x32(:,:,8))
  call vert_GGG_G(ntry, ex5, wf4(:,1), wf4(:,2), wf32(:,9), n4(:,15), t4x32(:,:,9))
  call vert_UV_W(ntry, wf4(:,1), Q(:,3), ex6, Q(:,32), wf8(:,3), n3(:,8), t3x8(:,:,3))
  call vert_GGG_G(ntry, wf4(:,2), ex5, ex7, wf16(:,7), n4(:,16), t4x16(:,:,7))
  call vert_GGG_G(ntry, ex5, ex7, wf4(:,2), wf16(:,8), n4(:,17), t4x16(:,:,8))
  call vert_GGG_G(ntry, ex7, wf4(:,2), ex5, wf16(:,9), n4(:,18), t4x16(:,:,9))
  call vert_UV_W(ntry, wf4(:,2), Q(:,12), ex6, Q(:,32), wf8(:,4), n3(:,9), t3x8(:,:,4))
  call vert_GGG_G(ntry, wf4(:,1), ex5, ex7, wf16(:,10), n4(:,19), t4x16(:,:,10))
  call vert_GGG_G(ntry, ex5, ex7, wf4(:,1), wf16(:,11), n4(:,20), t4x16(:,:,11))
  call vert_GGG_G(ntry, ex7, wf4(:,1), ex5, wf16(:,12), n4(:,21), t4x16(:,:,12))
  call vert_UV_W(ntry, wf4(:,1), Q(:,3), ex7, Q(:,64), wf8(:,5), n3(:,10), t3x8(:,:,5))
  call vert_GGG_G(ntry, wf4(:,2), ex5, ex6, wf16(:,13), n4(:,22), t4x16(:,:,13))
  call vert_GGG_G(ntry, ex5, ex6, wf4(:,2), wf16(:,14), n4(:,23), t4x16(:,:,14))
  call vert_GGG_G(ntry, ex6, wf4(:,2), ex5, wf16(:,15), n4(:,24), t4x16(:,:,15))
  call vert_UV_W(ntry, wf4(:,2), Q(:,12), ex7, Q(:,64), wf8(:,6), n3(:,11), t3x8(:,:,6))
  call vert_GGG_G(ntry, wf4(:,1), ex5, ex6, wf16(:,16), n4(:,25), t4x16(:,:,16))
  call vert_GGG_G(ntry, ex5, ex6, wf4(:,1), wf16(:,17), n4(:,26), t4x16(:,:,17))
  call vert_GGG_G(ntry, ex6, wf4(:,1), ex5, wf16(:,18), n4(:,27), t4x16(:,:,18))
  call vert_GGG_G(ntry, ex5, ex6, ex7, wf8(:,7), n4(:,28), t4x8(:,:,1))
  call vert_UV_W(ntry, wf4(:,1), Q(:,3), wf4(:,2), Q(:,12), wf16(:,19), n3(:,12), t3x16(:,:,1))
